package JavaAssignment1;

public class swap2numbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int m=9, n=5;
		int temp;
		System.out.println("Before Swap : m = " + m +", n = " +n);
		temp = m; 
		m = n;
		n=temp;
		System.out.println("After swap : m = " + m +", n = " +n);

	}

}
